import SignUp from '../components/signup';
import { makeStyles } from '@material-ui/styles';
import { Grid } from '@material-ui/core';

const useStyles = makeStyles({
	root : {
		minHeight : '100vh'
	}
});
export const Register = () => {
	const classes = useStyles();

	return (
		<Grid
			container
			spacing={0}
			direction="column"
			alignItems="center"
			justify="center"

		>
			<Grid item xs={6}>
				<SignUp />
			</Grid>   
		</Grid>
	);
};
